import React, { useState, useEffect, useRef } from 'react';
import { useNavigate } from 'react-router-dom';
import './MapSearch.css';

interface MapSearchProps {
  onStartChange: (value: string) => void;
  onEndChange: (value: string) => void;
  onSubmit: () => void;
}

const MapSearch: React.FC<MapSearchProps> = ({ onStartChange, onEndChange, onSubmit }) => {
  const [isDropdownOpen, setIsDropdownOpen] = useState(false);
  const navigate = useNavigate();
  const dropdownRef = useRef<HTMLDivElement>(null);

  // Toggle dropdown visibility
  const toggleDropdown = () => {
    setIsDropdownOpen((prev) => !prev);
  };

  // Handle navigation for each dropdown option
  const handleNavigation = (path: string) => {
    navigate(path);
    setIsDropdownOpen(false); // Close dropdown after navigation
  };

  // Close dropdown when clicking outside
  useEffect(() => {
    const handleClickOutside = (event: MouseEvent) => {
      if (dropdownRef.current && !dropdownRef.current.contains(event.target as Node)) {
        setIsDropdownOpen(false);
      }
    };

    document.addEventListener('mousedown', handleClickOutside);
    return () => {
      document.removeEventListener('mousedown', handleClickOutside);
    };
  }, []);

  return (
    <div className="map-search-container">
      <div className="input-group">
        <input
          type="text"
          onChange={(e) => onStartChange(e.target.value)}
          placeholder="Start"
          className="map-search-input start-input"
        />
        <div className="dots-icon">
          <span className="dot blue-dot"></span>
          <span className="dot gray-dot"></span>
          <span className="dot gray-dot"></span>
          <span className="dot gray-dot"></span>
          <span className="dot red-dot"></span>
        </div>
        <input
          type="text"
          onChange={(e) => onEndChange(e.target.value)}
          placeholder="End"
          className="map-search-input end-input"
        />
      </div>
      <div className="button-group">
        <button onClick={onSubmit} className="map-search-button">
          Start
        </button>
        <button className="bookmark-button">
          <svg
            width="24"
            height="24"
            viewBox="0 0 24 24"
            fill="none"
            stroke="#FFC107"
            strokeWidth="2"
            strokeLinecap="round"
            strokeLinejoin="round"
          >
            <path d="M19 21l-7-5-7 5V5a2 2 0 0 1 2-2h10a2 2 0 0 1 2 2z"></path>
          </svg>
        </button>
        <div className="menu-button-container" ref={dropdownRef}>
          <button className="menu-button" onClick={toggleDropdown}>
            <svg
              width="24"
              height="24"
              viewBox="0 0 24 24"
              fill="none"
              stroke="#000000"
              strokeWidth="2"
              strokeLinecap="round"
              strokeLinejoin="round"
            >
              <line x1="3" y1="12" x2="21" y2="12"></line>
              <line x1="3" y1="6" x2="21" y2="6"></line>
              <line x1="3" y1="18" x2="21" y2="18"></line>
            </svg>
          </button>
          {isDropdownOpen && (
            <div className="dropdown-menu">
              <button
                className="dropdown-item"
                onClick={() => handleNavigation('/preferences')}
              >
                Preferences
              </button>
              <button
                className="dropdown-item"
                onClick={() => handleNavigation('/help')}
              >
                Help
              </button>
              <button
                className="dropdown-item"
                onClick={() => handleNavigation('/login')}
              >
                Sign in
              </button>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default MapSearch;
